@ParkerMolloy @usambnl Not every German soldier was a Nazi. 

Nazi units were, however, embedded in army divisions. While the soldiers conducted war, the accompanying Nazi units murdered Jews and other innocents. 

Most soldiers were, thus, in the least, complicit.

